   /// @notice Returns the address of a valid Uniswap V3 Pool\n    /// @param factory The contract address of the Uniswap V3 factory\n    /// @param poolKey The identifying key of the V3 pool\n    /// @return pool The V3 pool contract address\n    function verifyCallback(address factory, PoolAddress.PoolKey memory poolKey)\n        internal\n        view\n        returns (IUniswapV3Pool pool)\n    {\n        pool = IUniswapV3Pool(PoolAddress.computeAddress(factory, poolKey));\n        require(msg.sender == address(pool));\n    }\n}\n","ast":{"absolutePath":"contracts/libraries/CallbackValidation.sol","exportedSymbols":{"CallbackValidation":[3154],"IUniswapV3Pool":[135],"IUniswapV3PoolActions":[245],"IUniswapV3PoolDerivedState":[276],"IUniswapV3PoolEvents":[395],"IUniswapV3PoolImmutables":[435],"IUniswapV3PoolOwnerActions":[461],"IUniswapV3PoolState":[569],"PoolAddress":[3361]},"id":3155,"license":"GPL-2.0-or-later","nodeType":"SourceUnit","nodes":[{"id":3094,"literals":["solidity","=","0.7",".6"],"nodeType":"PragmaDirective","src":"45:23:30"},{"absolutePath":"@uniswap/v3-core/contracts/interfaces/IUniswapV3Pool.sol","file":"@uniswap/v3-core/contracts/interfaces/IUniswapV3Pool.sol","id":3095,"nodeType":"ImportDirective","scope":3155,"sourceUnit":136,"src":"70:66:30","symbolAliases":[],"unitAlias":""},{"absolutePath":"contracts/libraries/PoolAddress.sol","file":"./PoolAddress.sol","id":3096,"nodeType":"ImportDirective","scope":3155,"sourceUnit":3362,"src":"137:27:30","symbolAliases":[],"unitAlias":""},{"abstract":false,"baseContracts":[],"contractDependencies":[],"contractKind":"library","documentation":{"id":3097,"nodeType":"StructuredDocumentation","src":"166:68:30","text":"@notice Provides validation for callbacks from Uniswap V3 Pools"},"fullyImplemented":true,"id":3154,"linearizedBaseContracts":[3154],"name":"CallbackValidation","nodeType":"ContractDefinition","nodes":[{"body":{"id":3121,"nodeType":"Block","src":"850:92:30","statements":[{"expression":{"arguments